ControlPropertyState.AutoRuleBindingString:
Concurrent(
    Set(
        Style,
        SelectedStyle
    ),
    Patch(
        Cache,
        LookUp(
            Cache,
            Key = "style"
        ),
        {Value: SelectedStyle.Name}
    );
    IfError(
        SaveData(
            Cache,
            "esignatureportal"
        ),
        Blank()
    )
)

